-- ----------------------------
-- Procedure structure for all_processs
-- ----------------------------
DROP PROCEDURE IF EXISTS `all_processs`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `all_processs`()
BEGIN
	call proc_update_ratio;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for proc_update_ratio
-- ----------------------------
DROP PROCEDURE IF EXISTS `proc_update_ratio`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `proc_update_ratio`()
BEGIN

	UPDATE kpi_moph t  set  t.ratio = ROUND((t.total/t.target)*100,2);
	UPDATE kpi_region t  set  t.ratio = ROUND((t.total/t.target)*100,2);
	UPDATE kpi_province t  set  t.ratio = ROUND((t.total/t.target)*100,2);
	UPDATE kpi_qof t  set  t.ratio = ROUND((t.total/t.target)*100,2);

END
;;
DELIMITER ;

