DROP EVENT IF EXISTS `event1`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` EVENT `event1` ON SCHEDULE EVERY 1 DAY STARTS '2015-04-09 08:47:00' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN

CALL all_processs;

END
;;
DELIMITER ;
